    }

render(){
    return(
    <div className="Todo">
      <Header />
      <form action="">
            <fieldset>
                <legend>Neue Aufgabe .</legend>
                <div><input type="text"></input></div>
                <br/>
                <div><button>Aufgabe Hinzufügen</button></div>

            </fieldset>

        </form>
        <AufgabenListe aufgaben={['aufgabe 1', 'blumen gießen', 'kochen', 'sport']}  />

    </div>
    )
  }
}
export default TodoApp;
